import React from 'react';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";

import HomePage from "./home/Page/HomePage.jsx";
import "./App.css";

function App() {
  return (
  <Router>
    <Switch>

      <Route path="about">
        <AboutPage />
      </Route>
      <Route path="resume">
        <ResumePage />
      </Route>
      <Route path="projects">
        <ProjectsPage />
      </Route>
      <Route path="contact">
        <ContactPage />
      </Route>
    </Switch>
  </Router>  
  );
}

export default App;
